import { Component } from "react";
import { Link } from "react-router-dom"
import './login.css'
import axios from "axios"
import { ToastContainer, toast } from 'react-toastify';

class Login extends Component {
    constructor(props) {
        super(props)
        this.state = {
            email: "",
            password: ""
        }

    }

    SendData = () => {
        axios.post(`${this.props.ip}/login`, ({
            email: this.state.email,
            password: this.state.password
        })).then((res) => {
            console.log(res.data)
            toast("Wow so easy !");

        })
    }

    render() {
        return (
            <div >

                <div className="fst_half container-fluid"
                    style={{
                        background: "#FF9900"
                    }}
                >
                    {/* Navbar */}
                    <nav className="navbar container" style={{ display: "flex", justifyContent: "space-around", padding: "3% 0" }}>
                        <div>
                            <h2 className="navbar-brand bb"><strong>Kavin</strong>Groups </h2>
                        </div>

                        <ToastContainer />

                        <div >
                            <div>
                                <Link to="/login" className="btn ll1" id='idll1'  >Login</Link>
                                <Link to="/signup" className="btn ll1" id='idll2' >Signup </Link>
                            </div>
                        </div>
                    </nav>
                </div>

                <div className="logg">
                    <h2>Login</h2>
                    <p>Email :</p>
                    <input type="email" className="form-control" onChange={(event) => {
                        this.setState(
                            {
                                email: event.target.value
                            }
                        )
                    }} /><br></br>
                    <p>Password :</p>
                    <input type="password" className="form-control" onChange={(event) => { this.setState({ password: event.target.value }) }} /><br></br>
                    <input type="button" value="Login" className="form-control btn"
                        onClick={this.FFf}
                        style={{ background: "#FF9900" }} /><br></br><br></br>
                    <Link to="/signup">New user ? </Link>

                </div>

            </div>
        )
    }
}

export default Login
